import { useEffect, useState } from "react";

function Results() {
    const [data, setData] = useState([{}])

    useEffect(() => {
        fetch("/analyze-html").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )
    }, [])
    
    return(
        <div className="App" id="results">
            {(typeof data.word_count == "undefined") ? (
                <p>loading ...</p>
            ) : (
                <>
                    <p>{ data.word_count }</p>
                    <p>{ data.tag_count }</p>
                    <p>{ data.tags }</p>
                </>
            )}
        </div>
    );
}

export default Results;
